project_contents_014: 
  name: Content-2
  updated_at: 2007-05-30 09:18:24
  body_html: "<?xml version=\"1.0\" encoding=\"utf-8\"?> <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\"> <html xmlns=\"http://www.w3.org/1999/xhtml\" lang=\"en\" xml:lang=\"en\"> <head> \t<title>Untitled document</title> \t<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" /> </head> <body> <p>Explains the architecture of Microsoft Office programming and introduces the object models<br />Teaches the three basic patterns of Office solutions: Office automation executables, Office add-ins, and code behind a document<br />Explores the ways of customizing Excel, Word, Outlook, and InfoPath, and plumbs the depths of programming with their events and object models<br />Introduces the VSTO programming model<br />Teaches how to use Windows Forms in VSTO and how to work with the Actions Pane<br />Delves into VSTO data programming and server data scenarios<br />Explores .NET code security and VSTO deployment<br />Advanced material covers working with XML in Word and Excel, developing COM add-ins for Word and Excel, and creating Outlook add-ins with VSTO.</p>  </body> </html>"
