project_contents_003: 
  name: rshell-67
  updated_at: 2007-05-30 09:18:24
  body_html: <?xml version="1.0" encoding="utf-8"?> <!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd"> <html xmlns="http://www.w3.org/1999/xhtml" lang="en" xml:lang="en"> <head> 	<title>Untitled document</title> 	<meta http-equiv="Content-Type" content="text/html; charset=utf-8" /> </head> <body> eploying and installing a managed COM add-in securely in Microsoft&reg; Office XP currently requires the assembly be hosted in an unmanaged COM add-in proxy component called a shim.<br /><br />By providing a Component Object Model (COM) Interop layer and COM Interop tools, Microsoft has made the transition of applications from the COM world to the .NET world as seamless as possible. You can implement COM (unmanaged) interfaces in .NET (managed code) and use those implementations transparently from COM-based clients. <br /><br />An assembly is analogous to a COM dynamic-link library (DLL) or executable (EXE) file. It&#39;s the logical unit where compiled code targeted at .NET is stored. Compiling a Microsoft Visual Basic&reg; .NET or Microsoft Visual C#&trade; class library project produces an assembly containing the Microsoft intermediate language (MSIL) code. The execution of the MSIL code is handled by the common language runtime. The common language runtime is different from other execution environments; to achieve optimal performance, the common language runtime compiles the MSIL into machine code. This machine code then runs without the major overhead of an interpreter. <br /><br />To ensure data integrity and authenticity of an assembly, strong names are used. Strong names are created using the strong name utility and implemented using public-key cryptography. Strong names ensure shared assemblies have globally unique names; a strong name comprise a simple text assembly name, version number, culture information, public key and digital signature. <br /><br />Here is how a shim is implemented to host a managed COM add-in. The shim is implemented in unmanaged Microsoft Visual C++&reg; in the Visual Studio .NET<br /> </body> </html>
