project_contents_015: 
  name: Content-4
  updated_at: 2007-05-30 09:18:24
  body_html: "<?xml version=\"1.0\" encoding=\"utf-8\"?> <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\"> <html xmlns=\"http://www.w3.org/1999/xhtml\" lang=\"en\" xml:lang=\"en\"> <head> \t<title>Untitled document</title> \t<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" /> </head> <body> <pre><br /> Droppables.add(&#39;id_of_element&#39;,[options]);<br /></pre>  \t<p>Options are:</p>   \t<table border=\"0\"> \t\t<tbody><tr> \t\t\t<th>Option</th> \t\t\t<th>since</th> \t\t\t<th>Default</th> \t\t\t<th>Description</th> \t\t</tr> \t\t<tr> \t\t\t<td>accept</td> \t\t\t<td><a href=\"http://wiki.script.aculo.us/scriptaculous/show/V1.0\" class=\"existingWikiWord\">V1.0</a></td> \t\t\t<td>(none)</td> \t\t\t<td>Set accept to a string or an array of strings describing <span class=\"caps\">CSS</span> classes. The Droppable will only accept Draggables that have one or more of these <span class=\"caps\">CSS</span> classes.</td> \t\t</tr> \t\t<tr> \t\t\t<td>containment</td> \t\t\t<td><a href=\"http://wiki.script.aculo.us/scriptaculous/show/V1.0\" class=\"existingWikiWord\">V1.0</a></td> \t\t\t<td>(none)</td> \t\t\t<td>The droppable will only accept the Draggable if the Draggable is contained in the given elements (or element ids). Can be a single element or an array of elements. This option is used by Sortables to control Drag-and-Drop between Sortables.</td> \t\t</tr> \t\t<tr> \t\t\t<td>hoverclass</td> \t\t\t<td><a href=\"http://wiki.script.aculo.us/scriptaculous/show/V1.0\" class=\"existingWikiWord\">V1.0</a></td> \t\t\t<td>(none)</td> \t\t\t<td>If set, the Droppable will have this additional <span class=\"caps\">CSS</span> class when an accepted Draggable is hovered over it.</td> \t\t</tr> \t\t<tr> \t\t\t<td>overlap</td> \t\t\t<td><a href=\"http://wiki.script.aculo.us/scriptaculous/show/V1.0\" class=\"existingWikiWord\">V1.0</a></td> \t\t\t<td>(none)</td> \t\t\t<td>If set to &lsquo;horizontal&rsquo; or &lsquo;vertical&rsquo; the droppable will only react to a Draggable if its overlapping by more than 50% in the given direction. Used by Sortables.</td> \t\t</tr> \t\t<tr> \t\t\t<td>greedy</td> \t\t\t<td><a href=\"http://wiki.script.aculo.us/scriptaculous/show/V1.1b1\" class=\"existingWikiWord\">V1.1b1</a></td> \t\t\t<td>true</td> \t\t\t<td>If true stops processing hovering (don&rsquo;t look for other Droppables that are under the Draggable)</td> \t\t</tr> \t</tbody></table>     \t<p>Additionally, following callbacks can be used in the option parameter:</p>   \t \t\t<table border=\"0\"><tbody><tr> \t\t\t<th>Callback</th> \t\t\t<th>since</th> \t\t\t<th>   Description</th> \t\t</tr> \t\t<tr> \t\t\t<td>onHover</td> \t\t\t<td><a href=\"http://wiki.script.aculo.us/scriptaculous/show/V1.0\" class=\"existingWikiWord\">V1.0</a></td> \t\t\t<td>Called whenever a Draggable is moved over the Droppable and the Droppable is affected (would accept it). The callback gets three parameters: the Draggable, the Droppable element, and the percentage of overlapping as defined by the overlap option. Used by Sortables.</td> \t\t</tr> \t\t<tr> \t\t\t<td>onDrop</td> \t\t\t<td><a href=\"http://wiki.script.aculo.us/scriptaculous/show/V1.0\" class=\"existingWikiWord\">V1.0</a></td> \t\t\t<td>Called whenever a Draggable is released over the Droppable and the Droppable is accepts it. The callback gets three parameters: the Draggable element, the Droppable element and the Event. You can extract additional information about the drop &ndash; like if the Ctrl or Shift keys were pressed &ndash; from the Event object.</td></tr></tbody></table> </body> </html>"
