  body_html: <?xml version="1.0" encoding="utf-8"?> <!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd"> <html xmlns="http://www.w3.org/1999/xhtml" lang="en" xml:lang="en"> <head> 	<title>Untitled document</title> 	<meta http-equiv="Content-Type" content="text/html; charset=utf-8" /> </head> <body> <p> Andrzej Krzywda has put together a solid, 15 point tutorial on <a href="http://andrzejonsoftware.blogspot.com/2007/05/15-tdd-steps-to-create-rails.html">how to build a Rails application from the ground up using Test Driven Development (TDD) techniques</a>. This is pure gold because so few of the books and &quot;how to build a blog in 5 minutes&quot; type articles bother to cover testing and Andrzej shows how to get into the habit from almost the first step.</p><p>&nbsp;</p><p>Andrzej Krzywda has put together a solid, 15 point tutorial on <a href="http://andrzejonsoftware.blogspot.com/2007/05/15-tdd-steps-to-create-rails.html">how to build a Rails application from the ground up using Test Driven Development (TDD) techniques</a>. This is pure gold because so few of the books and &quot;how to build a blog in 5 minutes&quot; type articles bother to cover testing and Andrzej shows how to get into the habit from almost the first step.</p><p>Andrzej Krzywda has put together a solid, 15 point tutorial on <a href="http://andrzejonsoftware.blogspot.com/2007/05/15-tdd-steps-to-create-rails.html">how to build a Rails application from the ground up using Test Driven Development (TDD) techniques</a>. This is pure gold because so few of the books and &quot;how to build a blog in 5 minutes&quot; type articles bother to cover testing and Andrzej shows how to get into the habit from almost the first step.</p><p>Andrzej Krzywda has put together a solid, 15 point tutorial on <a href="http://andrzejonsoftware.blogspot.com/2007/05/15-tdd-steps-to-create-rails.html">how to build a Rails application from the ground up using Test Driven Development (TDD) techniques</a>. This is pure gold because so few of the books and &quot;how to build a blog in 5 minutes&quot; type articles bother to cover testing and Andrzej shows how to get into the habit from almost the first step. </p>    </body> </html>
