  body_html: <?xml version="1.0" encoding="utf-8"?> <!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd"> <html xmlns="http://www.w3.org/1999/xhtml" lang="en" xml:lang="en"> <head> 	<title>Untitled document</title> 	<meta http-equiv="Content-Type" content="text/html; charset=utf-8" /> </head> <body> <table border="1" cellspacing="0" cellpadding="2" width="610" class="table" bordercolor="#eeeeee"><tbody><tr><td class="td3" width="568" bgcolor="#d4d5d8" background="images/green.png"><a href="http://www.osnews.com/story.php/17996/Future-Versions-of-Windows-To-Be-Fundamentally-Redesigned" class="non"><font face="Arial, Helvetica" size="3" color="#000000"><strong>Future Versions of Windows To Be &#39;Fundamentally Redesigned&#39;</strong></font></a></td></tr><tr><td class="td3" width="568" bgcolor="#f9f9f9"><font face="verdana,arial" size="1" color="#666666">&nbsp; Linked by <a href="http://www.osnews.com/editor.php?editors_id=11" class="non">Thom Holwerda</a> on 2007-05-30 09:55:20 UTC</font></td></tr><tr><td class="td3" colspan="2" width="610" valign="top" bgcolor="#ffffff"><p align="justify"><font face="arial" size="2" color="#000000">Microsoft executive Ty Carlson spoke about the future of Windows recently during a panel discussion at the Future in Review 2007 conference held in San Diego, California. Carlson said that future versions of Windows would have to be &#39;<a href="http://arstechnica.com/news.ars/post/20070529-microsoft-exec-next-version-of-windows-to-be-fundamentally-redesigned.html">fundamentally different</a>&#39; in order to take full advantage of future CPUs that will contain many processing cores. <em>&quot;You&#39;re going to see in excess of eight, 16, 64 and beyond processors on your client computer,&quot;</em> said Carlson, whose job title is director of technical strategy at Microsoft. Windows Vista, he said, was <em>&quot;designed to run on one, two, maybe four processors.&quot;</em></font></p></td></tr></tbody></table>  </body> </html>
