project_contents_009: 
  name: rshell-178
  updated_at: 2007-05-30 09:18:24
  body_html: <body><p><a href="http://classifier.rubyforge.org/">Classifier</a> is a Ruby gem developed by <a href="http://rufy.com/">Lucas Carlson</a> and David Fayram II to allow <a href="http://en.wikipedia.org/wiki/Naive_Bayes_classifier">Bayesian</a> and other types of classifications, including <a href="http://www.c2.com/cgi/wiki?LatentSemanticIndexing">Latent Semantic Indexing</a>.</p> <p>Bayes classifier is a probabilistic algorithm which apply <a href="http://en.wikipedia.org/wiki/Bayes%27_theorem" title="Bayesian refers to methods in probability and statistics named after the Reverend Thomas Bayes (ca. 1702&ndash;1761)">Bayes&rsquo; theorem</a> in order to learn the underlying probability distribution of the data. One popular use for this is implemented in most <a href="http://en.wikipedia.org/wiki/Bayesian_spam_filtering">spam filtering</a> packages.</p> It can also be applied to many other cases of machine learning to make your Ruby application more intelligent (the <a href="http://en.wikipedia.org/wiki/Latent_semantic_analysis" title="Latent semantic analysis (LSA) is a technique in natural language processing, in particular in vectorial semantics, of analyzing relationships between a set of documents and the terms they contain by producing a set of concepts related to the documents and terms.">complicated implementation</a> is transparently handled for you, thankfully!) <a href="http://www.igvita.com/" title="Igvita">Ilya Grigorik</a> recently <a href="http://www.igvita.com/blog/2007/05/23/bayes-classification-in-ruby/" title="Bayes Classification in Ruby">posted an interesting tutorial on Bayes classification</a>, with an easy-to-follow demonstration on how to use it for distinguishing between funny vs. not<p><a href="http://classifier.rubyforge.org/">Classifier</a> is a Ruby gem developed by <a href="http://rufy.com/">Lucas Carlson</a> and David Fayram II to allow <a href="http://en.wikipedia.org/wiki/Naive_Bayes_classifier">Bayesian</a> and other types of classifications, including <a href="http://www.c2.com/cgi/wiki?LatentSemanticIndexing">Latent Semantic Indexing</a>.</p> <p>Bayes classifier is a probabilistic algorithm which apply <a href="http://en.wikipedia.org/wiki/Bayes%27_theorem" title="Bayesian refers to methods in probability and statistics named after the Reverend Thomas Bayes (ca. 1702&ndash;1761)">Bayes&rsquo; theorem</a> in order to learn the underlying probability distribution of the data. One popular use for this is implemented in most <a href="http://en.wikipedia.org/wiki/Bayesian_spam_filtering">spam filtering</a> packages.</p> It can also be applied to many other cases of machine learning to make your Ruby application more intelligent (the <a href="http://en.wikipedia.org/wiki/Latent_semantic_analysis" title="Latent semantic analysis (LSA) is a technique in natural language processing, in particular in vectorial semantics, of analyzing relationships between a set of documents and the terms they contain by producing a set of concepts related to the documents and terms.">complicated implementation</a> is transparently handled for you, thankfully!) <a href="http://www.igvita.com/" title="Igvita">Ilya Grigorik</a> recently <a href="http://www.igvita.com/blog/2007/05/23/bayes-classification-in-ruby/" title="Bayes Classification in Ruby">posted an interesting tutorial on Bayes classification</a>, with an easy-to-follow demonstration on how to use it for distinguishing between funny vs. not    </body> </html>
